import React from 'react';
import { Link } from 'react-router-dom';
import '../style.css'

export default class SidebarView extends React.Component {
    render() {
        return (
            <div className="sidebar">
                <Link to="/about-me">ABOUT ME</Link>
                <Link to="/resume">RESUME</Link>
                <div></div>
            </div>
        );
    }
}
